import {Link, useNavigate } from 'react-router-dom';

import { useUser, useUpdate } from '../Context.js'
import './home.css'

function Home() {
    const navigate = useNavigate();
    const websiteUser = useUser();
    const updateWebsiteUser = useUpdate();

  // useEffect(()=>{
  //   if(websiteUser.name == 'Logged Out'){
  //     navigate('/')
  //     console.log(websiteUser)
  //   }
  // }, [])


  return (
      <div className = 'container'>
        <header>
            <h3 className = 'text'>Header Logo</h3>
            <nav>
              <a href='#' className = 'text'  >Header Link One</a>
              <a href='#' className = 'text'>Header Link Two</a>
              <a href='#' className = 'text'>Header Link Three</a>
            </nav>
            <h1 className = 'text' id='awesome-website'>This website <br/>is awesome</h1>
            <p className = 'text' id='first-p'>This website has some subtext that goes here under the <br/>main title. It is a smaller font and the color
                  is a lower <br/>contrast</p>
            <img src='https://mytechdecisions.com/wp-content/uploads/2019/10/AdobeStock_256229414.jpg' alt='Image' id='img'/>
            <button type='submit' id='sign-up'>Sign Up</button>
        </header>
          <h4 className = 'info'><big/>More information about us<big/></h4>
          <section>

            <div className = 'boxes'>We have many different programs around the world</div>
            <div className = 'boxes'>We are the second to largest web design company in the world</div>
            <div className = 'boxes'>We offer web design help to some of the largest companies in the world</div>

          </section>
          <footer>
            <p className = 'last-p'>If you have any questions please call us at <bold>333-628-3822</bold>
            </p>
          </footer>
      </div>
  )
}

export default Home
